import React, { useState } from "react";
import Video from "../../videos/video.mp4";
import {
  HeroContainer,
  HeroBg,
  VideoBg,
  HeroContent,
  HeroH1,
  HeroP,
  HeroBtnWrapper,
  Button,
  ArrowForward,
  ArrowRight,
} from "./HeroElements";

const HeroSection = () => {
  return (
    <>
      <HeroContainer>
        <HeroBg>
          <VideoBg autoPlay loop muted src={Video} type="video/mp4" />
        </HeroBg>
        <HeroContent>
          <HeroH1>Asigurare UK</HeroH1>
          <HeroP>Completeaza un formular</HeroP>
          {/* <HeroBtnLink to='https://form.jotformeu.com/61345148994364'>
            Formular Asigurare
          </HeroBtnLink>
          <HeroBtnLink to='https://form.jotformeu.com/73354099456365'>
            Заполните анкету
          </HeroBtnLink>
          <HeroBtnLink to='https://form.jotformeu.com/92712547528362'>
            Попълнете формуляра
          </HeroBtnLink> */}
          <HeroBtnWrapper>
            <Button to="signup">
              Get started {hover ? <ArrowForward /> : <ArrowRight />}
            </Button>
          </HeroBtnWrapper>
        </HeroContent>
      </HeroContainer>
    </>
  );
};

export default HeroSection;
